class Solution(object):
    def hasGroupsSizeX(self, deck):
        nums = deck
        a = {}
        if nums==[]:
            return False
        for num in nums:
            if num not in a.keys():
                a[num] = 1
            else:
                a[num] += 1
        res = list(a.values())
        if len(res) == 1 and res[0] < 2 :
            return False
        ret=[]
        print(res)
        for i in range(len(res)):
            if i==1:
                for j in range(2,min(res[i],res[i-1])+1):
                    if not res[i]%j and  not res[i-1]%j:
                        ret.append(j)
                if not ret:
                    return False
            if i>1:
                flag = True
                for x in ret:
                    if not res[i]%x:
                        flag =not flag
                        break
                if flag:
                    return False
        return True


